import './TopBar.scss';

class TopBar extends React.Component {
  render () {
    return (
      <div id="navigation-bar">
        <nav>
          <ul>
            <li><a href="" onClick={() => this.props.handler(0)}>Home</a></li>
            <li><a href="" onClick={() => this.props.handler(1)}>Projects</a></li>
            <li><a href="" onClick={() => this.props.handler(2)}>Personal</a></li>
          </ul>
        </nav>
      </div>
    )
  }
}

export default TopBar;
